import "./app-header.css";

const AppHeader = ({ toDo, done }) => {
  return (
    <div className="app-header">
      <h1>My Todo list</h1>
      <h2>
        {toDo} more to do, {done} done
      </h2>
    </div>
  );
};

export default AppHeader;
